// ==================== LOGO BASE64 CONFIGURATION ====================
// File: logo-base64.js
// Tempat untuk menyimpan logo dalam format Base64

// ================================
// TEMPAT UNTUK MENEMPEL LOGO BASE64 ANDA:
// ================================

const LOGO_BASE64 = "data:image/png;base64,";

function validateLogoBase64() {
    if (!LOGO_BASE64 || LOGO_BASE64 === 'DATA_BASE64_LOGO_ANDA_DISINI') {
        console.warn(' Logo Base64 belum dikonfigurasi. Gunakan fallback.');
        return false;
    }
    
    // Validasi format Base64
    const base64Regex = /^data:image\/(png|jpeg|jpg|gif|svg\+xml);base64,[A-Za-z0-9+/]+=*$/;
    if (!base64Regex.test(LOGO_BASE64)) {
        console.error(' Format Base64 logo tidak valid.');
        return false;
    }
    
    console.log(' Logo Base64 valid dan siap digunakan.');
    return true;
}

// ================================
// FUNGSI UTILITAS UNTUK LOGO
// ================================

/**
 * Mendapatkan tipe MIME dari Base64 string
 * @returns {string} Tipe MIME (image/png, image/jpeg, dll)
 */
function getLogoMimeType() {
    if (!LOGO_BASE64) return null;
    const match = LOGO_BASE64.match(/^data:image\/(\w+);base64/);
    return match ? `image/${match[1]}` : null;
}

/**
 * Mendapatkan ekstensi file dari Base64 string
 * @returns {string} Ekstensi file (png, jpg, svg, dll)
 */
function getLogoFileExtension() {
    if (!LOGO_BASE64) return null;
    const match = LOGO_BASE64.match(/^data:image\/(\w+);base64/);
    return match ? match[1] : null;
}

/**
 * Memeriksa apakah logo tersedia dan valid
 * @returns {boolean} True jika logo tersedia dan valid
 */
function isLogoAvailable() {
    return validateLogoBase64();
}

// ================================
// INISIALISASI DAN VALIDASI
// ================================

// Validasi otomatis saat file dimuat
document.addEventListener('DOMContentLoaded', function() {
    if (isLogoAvailable()) {
        console.log(' Logo Base64 berhasil dimuat dan siap digunakan.');
    } else {
        console.log(' Logo Base64 tidak tersedia, sistem akan menggunakan fallback.');
    }
});

// Export untuk penggunaan di module lain
if (typeof module !== 'undefined' && module.exports) {
    module.exports = {
        LOGO_BASE64,
        validateLogoBase64,
        getLogoMimeType,
        getLogoFileExtension,
        isLogoAvailable
    };
}